import React from "react";
import Part from "./Part";
const Content = (props) => {
  const part1 = props.parts[0];
  const part2 = props.parts[1];
  const part3 = props.parts[2];
  return (
    <div>
      <Part name={part1.name} exerc={part1.exercises} />
      <Part name={part2.name} exerc={part2.exercises} />
      <Part name={part3.name} exerc={part3.exercises} />
    </div>
  );
};
export default Content;
